def relu(x):
    x[x<0] = 0
    return x

# numpy has np.tanh

class Linear:
    def __init__(self, weight, bias):
        self.weight = weight
        self.bias = bias
    
    def forward(self, x):
        #print(x.shape, self.weight.shape, self.bias.shape)
        return np.matmul(x, self.weight.T) + self.bias

class Conv2d:
    def __init__(self, weight, bias, stride = 1, padding = 0):
        self.weight = weight
        self.bias = bias
        self.stride = stride
        self.pad = padding
        
    def forward(self, x):
        N, C, H, W = x.shape
        F, _, HH, WW = self.weight.shape

        # Check dimensions
        #assert (W + 2 * self.pad - WW) % self.stride == 0, 'width does not work'
        #assert (H + 2 * self.pad - HH) % self.stride == 0, 'height does not work'

        p = self.pad
        x_padded = np.pad(x, ((0, 0), (0, 0), (p, p), (p, p)), mode='constant')

        H += 2 * self.pad
        W += 2 * self.pad
        out_h = int((H - HH) / self.stride + 1)
        out_w = int((W - WW) / self.stride + 1)

        shape = (C, HH, WW, N, out_h, out_w)
        strides = (H * W, W, 1, C * H * W, self.stride * W, self.stride)
        strides = x.itemsize * np.array(strides)
        
        x_stride = np.lib.stride_tricks.as_strided(x_padded, shape=shape, strides=strides).reshape((C * HH * WW, N * out_h * out_w))
        #x_cols = np.ascontiguousarray(x_stride)
        #x_cols.shape = (C * HH * WW, N * out_h * out_w)
        #res = self.weight.reshape(F, -1).dot(x_cols) + self.bias.reshape(-1, 1)
        res = self.weight.reshape(F, -1).dot(x_stride) + self.bias.reshape(-1, 1)
        
        res.shape = (F, N, out_h, out_w)
        out = res.transpose(1, 0, 2, 3)
        out = np.ascontiguousarray(out)
        return out

class GroupsConv2d:
    def __init__(self, weight, bias, stride = 1, padding = 0):
        self.weight = weight
        self.bias = bias
        self.stride = stride
        self.padding = padding
    
    def forward(self, x):
        p = self.padding
        x = np.pad(x, ((0, 0), (0, 0), (p, p), (p, p)), mode='constant')
        _, C, H, W = x.shape # batch should always be 1
        F, _, HH, WW = self.weight.shape #(out_channel, 1, height, width)
        
        #assert F==C, 'wrong channel number'
        out_h = H-HH+1
        out_w = W-WW+1
        shape = (1, C, out_h, out_w, HH, WW)
        strides = (x.itemsize * W * H * C, x.itemsize * W * H, x.itemsize * W, x.itemsize, x.itemsize * W, x.itemsize)

        x_stride = np.lib.stride_tricks.as_strided(x, shape=shape, strides=strides).reshape(1, C, out_h * out_w, HH * WW)
        #x_cols = np.ascontiguousarray(x_stride)

        weight = self.weight.reshape(1, F, HH*WW, 1)

        return np.matmul(x_stride, weight).reshape(1, F, out_h, out_w) + self.bias[None,:, None, None]


class BatchNorm:
    def __init__(self, weight, bias, mean, var):
        self.weight = weight
        self.bias = bias
        self.mean = mean
        self.var = var + 1e-5
    
    def forward(self, x):
        tmp = (x - self.mean[None, :, None, None]) / np.sqrt(self.var[None, :, None, None])
        return self.weight[None, :, None, None] * tmp + self.bias[None, :, None, None]

class OthelloNet_CNN:
    def __init__(self, weights):
        self.conv1 = Conv2d(weights[0], weights[1], stride=1, padding=1)

        self.conv2_1 = Conv2d(weights[2], weights[3], stride=1)
        self.conv2_2 = GroupsConv2d(weights[4], weights[5], stride=1, padding=1)
        self.conv2_3 = Conv2d(weights[6], weights[7], stride=1)

        self.conv3_1 = Conv2d(weights[8], weights[9], stride=1)
        self.conv3_2 = GroupsConv2d(weights[10], weights[11], stride=1, padding=1)
        self.conv3_3 = Conv2d(weights[12], weights[13], stride=1)

        self.conv4_1 = Conv2d(weights[14], weights[15], stride=1)
        self.conv4_2 = GroupsConv2d(weights[16], weights[17], stride=1, padding=1)
        self.conv4_3 = Conv2d(weights[18], weights[19], stride=1)

        self.conv5_1 = Conv2d(weights[14], weights[15], stride=1)
        self.conv5_2 = GroupsConv2d(weights[16], weights[17], stride=1, padding=1)
        self.conv5_3 = Conv2d(weights[18], weights[19], stride=1)

        self.conv_p = Conv2d(weights[20], weights[21], stride=1)
        self.fc_p = Linear(weights[22], weights[23])

        self.conv_v = Conv2d(weights[24], weights[25], stride=1)
        self.fc_v1 = Linear(weights[26], weights[27])
        self.fc_v2 = Linear(weights[28], weights[29])

        self.bn1 = BatchNorm(weights[30], weights[31], weights[32], weights[33])

        self.bn2_1 = BatchNorm(weights[34], weights[35], weights[36], weights[37])
        self.bn2_2 = BatchNorm(weights[38], weights[39], weights[40], weights[41])
        self.bn2_3 = BatchNorm(weights[42], weights[43], weights[44], weights[45])

        self.bn3_1 = BatchNorm(weights[46], weights[47], weights[48], weights[49])
        self.bn3_2 = BatchNorm(weights[50], weights[51], weights[52], weights[53])
        self.bn3_3 = BatchNorm(weights[54], weights[55], weights[56], weights[57])

        self.bn4_1 = BatchNorm(weights[58], weights[59], weights[60], weights[61])
        self.bn4_2 = BatchNorm(weights[62], weights[63], weights[64], weights[65])
        self.bn4_3 = BatchNorm(weights[66], weights[67], weights[68], weights[69])

        self.bn_p = BatchNorm(weights[70], weights[71], weights[72], weights[73])
        self.bn_v = BatchNorm(weights[74], weights[75], weights[76], weights[77])

    def forward(self, board):
        x = board
        x = relu(self.bn1.forward(self.conv1.forward(x)))

        x = relu(self.bn2_1.forward(self.conv2_1.forward(x)))
        x = relu(self.bn2_2.forward(self.conv2_2.forward(x)))
        x = self.bn2_3.forward(self.conv2_3.forward(x))

        x = relu(self.bn3_1.forward(self.conv3_1.forward(x)))
        x = relu(self.bn3_2.forward(self.conv3_2.forward(x)))
        x = self.bn3_3.forward(self.conv3_3.forward(x))

        x = relu(self.bn4_1.forward(self.conv4_1.forward(x)))
        x = relu(self.bn4_2.forward(self.conv4_2.forward(x)))
        x = self.bn4_3.forward(self.conv4_3.forward(x))

        p = relu(self.bn_p.forward(self.conv_p.forward(x)) )
        #print(p.shape)
        p = self.fc_p.forward(p.reshape(-1, 4*8*8))
        p = log_softmax(p).reshape(-1,8,8)

        v = relu(self.bn_v.forward(self.conv_v.forward(x)) ).reshape(-1, 2*8*8)
        v = relu(self.fc_v1.forward(v))
        v = np.tanh(self.fc_v2.forward(v))

        return p, v

def softmax(x):
    x = np.exp(x)

    s = np.sum(x)
    if s>0:
        return x / s
    else:
        x[:] = 1
        return x / np.sum(x)

def log_softmax(x):
    e_x = np.exp(x - np.max(x))
    return np.log(e_x / e_x.sum())

def normalize_possibility(x):
    return x / np.sum(x)

class MCTS:
    def __init__(self, network):
        self.Q_sa = {} #Q(s,a) RESERVED
        self.N = {}  #N(s)
        self.N_sa = {}  #N(s,a)
        self.P_s = {}   #P(s)
        self.moves = {}
        self.status = {} #status for state s, -1, 1 or 0
        self.network = network

    def get_pi(self, board, temp = 1):
        res = np.zeros((8,8))
        s = board.encode_board()

        N = self.N.get(s, 0)
        
        if temp == True:
            for x in range(8):
                for y in range(8):
                    res[x][y] = self.N_sa.get((s,x,y), 0) / N
            
            return res
        
        else: #temp == 0
            max_N = 0
            for x in range(8):
                for y in range(8):
                    res[x][y] = self.N_sa.get((s,x,y), 0)
                    max_N = max(max_N, res[x][y])
            
            if max_N > 0:
                res[res < max_N] = 0
                res /= np.sum(res)
            return res

    def get_next_move(self, board, temp):
        s = board.encode_board()

        if temp == True:
            N = self.N[s]
            #print("N is : ",N)

            possible_moves = self.moves.get(s, board.get_possible_moves())
            possibilities = np.zeros(len(possible_moves[0]), dtype=np.float)

            for i,(x,y) in enumerate(zip(possible_moves[0], possible_moves[1])):
                possibilities[i] = self.N_sa.get((s,x,y), 0) / N

            return possibilities, possible_moves
        else:# temp == 0
            possible_moves = self.moves.get(s, board.get_possible_moves())
            possibilities = np.zeros(len(possible_moves[0]), dtype=np.float)
            max_p = 0
            for i,(x,y) in enumerate(zip(possible_moves[0], possible_moves[1])):
                possibilities[i] = self.N_sa.get((s,x,y), 0)
                max_p = max(max_p, possibilities[i])
            
            possibilities[possibilities < max_p] = 0
            possibilities /= np.sum(possibilities)
            return possibilities, possible_moves

    def search_on(self, board, depth=1):
        # stackoverflow
        # if depth > 300:
        #     print(board.get_board())
        s = board.encode_board()

        # board is at the end state
        if s in self.status:
            game_status = self.status[s]
        else:
            game_status = board.current_status()
            self.status[s] = game_status
        
        if game_status[0]==True:
            return -game_status[1]
        
        # is s the leaf node?
        if s not in self.P_s:
            # indeed the leaf do_expansion
            # (batch(1), 8, 8)
            p, v = self.network.forward(
                (board.get_player() * board.get_board()).astype(float32).reshape(1,1,8,8)
            )
            #print(p)
            #print(v)
            p = p.squeeze()
            v = v.squeeze()
            possible_moves = board.get_possible_moves()
            # print(p)
            # print(possible_moves)
            possibilities = p[possible_moves]
            possibilities = softmax(possibilities) # 0 possibility?

            self.P_s[s] = possibilities
            self.moves[s] = possible_moves
            self.N[s] = 0

            return -v
        
        possible_moves = self.moves[s]
        possibilities = self.P_s[s]
        max_u = -1e10
        best_x = -1
        best_y = -1
        for i,(x,y) in enumerate(zip(possible_moves[0], possible_moves[1])):
            # x,y is a
            if (s,x,y) in self.Q_sa:
                upper_confidence = self.Q_sa[(s,x,y)] + MCTS_C * possibilities[i] * (self.N[s]) ** 0.5 / (1+ self.N_sa[(s,x,y)])
            else:
                upper_confidence = MCTS_C * possibilities[i] * (self.N[s]+0.000001)**0.5 #?

            if upper_confidence > max_u:
                max_u = upper_confidence
                best_x = x
                best_y = y

        #print(best_x, best_y)
        board.move(best_x, best_y)
        board.switch_player()

        v = self.search_on(board, depth+1)

        nsa = self.N_sa.get((s,best_x,best_y), -1)
        if nsa != -1:
            self.Q_sa[(s,best_x,best_y)] = (nsa * self.Q_sa[(s,best_x,best_y)] + v) / (nsa +1)
            self.N_sa[(s,best_x,best_y)] += 1
            
        else:
            self.Q_sa[(s,best_x,best_y)] = v
            self.N_sa[(s,best_x,best_y)] = 1
        
        #print("!")
        self.N[s]+=1
        return -v

